import React,{Component} from 'react';
import {Label, Input,Button} from 'reactstrap';
import AppNavbar from "./home/AppNavbar";

class JoinCourse extends Component{
    constructor(props) {
        super(props);
        this.state = {
            studentId: '',
            courseId: '',
        }
    };
    //handle Submit
    handleSubmit(e) {

        const join = {
            "studentId": e.join.studentId,
            "courseId": e.join.courseId,
        };
        alert(join.studentId + ", " + join.courseId);

        fetch('http://localhost:3000/api/students/join-a-course', {
            method: 'POST',
            headers: {
                'content-type': 'application/json'
            },
            body: JSON.stringify(join)
        }).then(response => {
            console.log(response)
        }).catch(err => {
            console.log(err);
        });
    }

    //handle On Submit
    handleOnSubmit(e) {
        e.preventDefault();

        const join_details = {
            studentId: document.getElementById('studentId').value,
            courseId: document.getElementById('courseId').value,

        };

        this.handleSubmit({join: join_details});
    }

    render() {
        return (
            <div>
                <AppNavbar/>
                <div className='container bg-light'>
                    <div className='row'>
                        <div className='card' style={{margin: 'auto'}}>
                            <div className='card-header'>
                                <h1 className='modal-header'>JOIN COURSE</h1>
                            </div>
                            <div className='card-body'>
                                <form onSubmit={value => this.handleOnSubmit(value)}>
                                    <Label htmlFor="studentId">StudentId: </Label>
                                    <Input type="text" className='form-control' name='studentId' id='studentId' required/>
                                    <Label htmlFor="courseId">CourseId: </Label>
                                    <Input type="text" className='form-control' name='courseId' id='courseId' required/>
                                    <div className='form-group'>
                                        <Button type='submit' color="dark" className="btn btn-block">Join Course</Button>
                                    </div>
                                </form>
                            </div>
                        </div>
                    </div>
                </div>
            </div>
        );
    }
}
export default JoinCourse;
